        React.createElement("path", { d: "M3 6a1 1 0 011-1h16a1 1 0 110 2H4a1 1 0 01-1-1z", fill: primaryFill }),
        React.createElement("path", { d: "M8 10a1 1 0 011-1h11a1 1 0 110 2H9a1 1 0 01-1-1z", fill: primaryFill }),
        React.createElement("path", { d: "M8 14a1 1 0 011-1h11a1 1 0 110 2H9a1 1 0 01-1-1z", fill: primaryFill }),
        React.createElement("path", { d: "M20 19H4a1 1 0 110-2h16a1 1 0 110 2z", fill: primaryFill }),
        React.createElement("path", { d: "M3.3 11.2a1 1 0 011.4-1.4l1.5 1.5a1 1 0 010 1.4l-1.5 1.5a1 1 0 01-1.4-1.4l.79-.8-.8-.8z", fill: primaryFill }));
};
const TextContinuous24Filled = wrapIcon(rawSvg({}), 'TextContinuous24Filled');
export default TextContinuous24Filled;
